import React from "react";
import "./Home.css";
function Home() {
  return (
    <div className="head">
      <button unselectable="on" className="button">Login</button>
      <button unselectable="on" hide-foc className="button">Signup</button>
      <br />
      <div className="body">
        Email ID : <input type="text" /><br />
        Password : <input type="password" />
      </div>
    </div>
  );
}

export default Home;
